import React from "react";
import "../css/CsvHeader.css"

const CsvHeader = ({header, data}) => {

  let arr = [];
  let newData = [data[1], data[2], data[3]];
  for (let i = 0; i < newData.length; i++) {
    arr.push(newData[i]['"Date"'] );
  }
  console.log(arr, "arr");

  return (
    <div className="csv-header">
      <h1>{header}</h1>
    </div>
  )

}

export default CsvHeader;
